function schemeTest(scheme, [r2, r3, r5, r11, r17, r]) {
  const o2 = Plot.plot({color: {scheme, type: "ordinal", domain: "AB"}}).scale("color");
  const o3 = Plot.plot({color: {scheme, type: "ordinal", domain: "ABC"}}).scale("color");
  const o5 = Plot.plot({color: {scheme, type: "ordinal", domain: "ABCDE"}}).scale("color");
  const o11 = Plot.plot({color: {scheme, type: "ordinal", domain: "ABCDEFGHIJK"}}).scale("color");
  const o17 = Plot.plot({color: {scheme, type: "ordinal", domain: "ABCDEFGHIJKLMNOPQ"}}).scale("color");
  assert.deepStrictEqual(o2.range, r2);
  assert.deepStrictEqual(o3.range, r3);
  assert.deepStrictEqual(o5.range, r5);
  assert.deepStrictEqual(o11.range, r11);
  assert.deepStrictEqual(o17.range, r17);
  if (r != null) {
    const c = Plot.plot({color: {scheme, type: "linear"}}).scale("color");
    assert.deepStrictEqual([0, .2, .5, .7, 1].map(c.apply), r);
  }
}
